import classes from './MealsSummary.module.css';

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2> Quality without compromises</h2>
      <p>Explore a range of products that allow you to take care of your dog and your cat everyday in an eco-friendly, complete, healthy and loving way.
      </p>
      <p>
        All our meals are cooked with high-quality ingredients, just-in-time and
        of course by experienced chefs!
      </p>
    </section>
  );
};

export default MealsSummary;
